import React from 'react'

import './header.styles.scss'

const Header = () => {
    return (
        <header>
            <img src='https://images.unsplash.com/photo-1555396273-367ea4eb4db5?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1567&q=80' alt=""/>  
            <div className="overlay">
                <h1>Just do it</h1>
            </div>
            <span>Shop now</span>

        </header>
    )
}

export default Header;
